import React from 'react';
export default function Skills() {
  return (
    <section className="p-8 text-white">
      <h2 className="text-3xl font-bold mb-4">Skills</h2>
      <ul className="list-disc list-inside">
        <li>Python</li>
        <li>SQL</li>
        <li>Power BI</li>
        <li>Machine Learning</li>
        <li>Deep Learning</li>
      </ul>
    </section>
  );
}
